import React from "react";
import { Menu } from "antd";

import "../../App.css"
import { BuildOutlined, CodeOutlined, ForkOutlined, GithubFilled, HomeOutlined, OrderedListOutlined, RadarChartOutlined, RedoOutlined } from "@ant-design/icons";

function Navbar() {
	return (
		<div>

			<Menu className="Navbar"
				items={[
					{ label: 'Home', icon: <HomeOutlined /> },
					{ label: 'Automaten Generieren', icon: <RedoOutlined /> },
					{ label: 'RISC-V Befehle', icon: <CodeOutlined /> },
					{ label: 'Pipeline Konflikte', icon: <OrderedListOutlined /> },
					{ label: 'BDD Generator', icon: <ForkOutlined /> },
					{ label: 'AIG Generator', icon: <BuildOutlined /> },
					{ label: 'SAT Solver', icon: <RadarChartOutlined /> },
					{ label: 'Kontakt', icon: <GithubFilled /> },
				]}>

			</Menu>
		</div>

	)
}

export default Navbar
